import React from 'react'
import profile from '../blank-profile-picture.png';

const Tweet = () => {
    return (
        <div className="tweet-container">
            <span><a href="/"><img src="../blank-profile-picture.png"></img></a><p>This is a Tweet.</p></span>
        </div>
    )
}

export default Tweet
